import React from 'react'

export default class Weather2 extends React.Component {

    constructor(props) {
        super(props)
    }

    render() {
        return (
            <div>

                <h2 className='weather-info'>
                    The city is : 
                    <span className='weather-value'>
                        {this.props.city}
                    </span>
                </h2>

                <h2 className='weather-info'>
                    The temp is : 
                    <span className='weather-value'>
                        {this.props.temp}
                    </span>
                </h2>

                <h2 className='weather-info'>
                    The wind speed is : 
                    <span className='weather-value'>
                        {this.props.wind}
                    </span>
                </h2>

            </div>
        )
    }
}
